import { motion } from 'framer-motion';

export const leterOne = {
    init: {
        opacity: 0
    },
    after: {
        opacity: 1,
        transition: {
            delay: .2,
            duration: 1.25
        }
    }
}

export const leterTwo = {
    init: {
        opacity: 0
    },
    after: {
        opacity: 1,
        transition: {
            delay: .3,
            duration: 1.25
        }
    }
}

export const leterThree = {
    init: {
        opacity: 0
    },
    after: {
        opacity: 1,
        transition: {
            delay: .4,
            duration: 1.25
        }
    }
}
